import React from 'react'
import { Text, View, Button, Image, StyleSheet } from 'react-native'
import { TouchableOpacity } from 'react-native-gesture-handler'

const ProgrammingScreen = ({ navigator }) => {
    return (
        <View>
            <Text style={styles.textStyle}>Welcome To C Programming</Text>
            <TouchableOpacity onPress={() => navigation.navigator('MoreProg') }>
                <Image 
                    source={require('../../assets/programming.png')}
                    style={style.imageStyle}
                />
            </TouchableOpacity>
        </View>
    )
}

const styles = StyleSheet.create({
    textStyle: {
        fontSize: 40
    },
    imageStyle: {
        height: 400,
        width: 400,
    }
})

export default ProgrammingScreen
